const e=JSON.parse('{"key":"v-d4cbd96c","path":"/reading/algorithm/offer_oriented/AL_DS/12_sort/12.1.html","title":"12.1 排序基础","lang":"zh-CN","frontmatter":{"title":"12.1 排序基础","date":"2023-09-13T00:00:00.000Z","category":["algorithm"]},"headers":[{"level":2,"title":"12.1.1 问题74: 合并区间","slug":"_12-1-1-问题74-合并区间","link":"#_12-1-1-问题74-合并区间","children":[{"level":3,"title":"12.1.1.1 分析&题解","slug":"_12-1-1-1-分析-题解","link":"#_12-1-1-1-分析-题解","children":[]}]},{"level":2,"title":"Reference","slug":"reference","link":"#reference","children":[]}],"git":{"updatedTime":1694730194000},"readingTime":{"minutes":1.23,"words":368},"filePathRelative":"reading/algorithm/offer_oriented/AL_DS/12_sort/12.1.md","localizedDate":"2023年9月13日","excerpt":"<p>排序之后的数据有利于使用二分查找, 在某些情况下可以优化效率.</p>\\n<p>常用的排序:</p>\\n<ul>\\n<li>计数排序</li>\\n<li>快速排序</li>\\n<li>归并排序</li>\\n</ul>\\n<h2> 12.1.1 问题74: 合并区间</h2>\\n<p><a href=\\"https://leetcode.cn/problems/SsGoHC/\\" target=\\"_blank\\" rel=\\"noopener noreferrer\\">LCR 074. 合并区间</a></p>\\n<blockquote>\\n<p>以数组 <code>intervals</code> 表示若干个区间的集合，其中单个区间为 <code>intervals[i] = [starti, endi]</code> 。请你合并所有重叠的区间，并返回一个不重叠的区间数组，该数组需恰好覆盖输入中的所有区间。</p>\\n<p><strong>示例 1：</strong></p>\\n<div class=\\"language-text line-numbers-mode\\" data-ext=\\"text\\"><pre class=\\"language-text\\"><code>输入：intervals = [[1,3],[2,6],[8,10],[15,18]]\\n输出：[[1,6],[8,10],[15,18]]\\n解释：区间 [1,3] 和 [2,6] 重叠, 将它们合并为 [1,6].\\n</code></pre><div class=\\"line-numbers\\" aria-hidden=\\"true\\"><div class=\\"line-number\\"></div><div class=\\"line-number\\"></div><div class=\\"line-number\\"></div></div></div><p><strong>示例 2：</strong></p>\\n<div class=\\"language-text line-numbers-mode\\" data-ext=\\"text\\"><pre class=\\"language-text\\"><code>输入：intervals = [[1,4],[4,5]]\\n输出：[[1,5]]\\n解释：区间 [1,4] 和 [4,5] 可被视为重叠区间。\\n</code></pre><div class=\\"line-numbers\\" aria-hidden=\\"true\\"><div class=\\"line-number\\"></div><div class=\\"line-number\\"></div><div class=\\"line-number\\"></div></div></div><p><strong>提示：</strong></p>\\n<ul>\\n<li><code>1 &lt;= intervals.length &lt;= 10^4</code></li>\\n<li><code>intervals[i].length == 2</code></li>\\n<li><code>0 &lt;= starti &lt;= endi &lt;= 10^4</code></li>\\n</ul>\\n</blockquote>"}');export{e as data};
